import React, { Component } from 'react';
import '../style.css';

import Colors from '../colors';

const Job = (props) => {
	return (
		<div style={{ width: '100%' }}>
			<div className="my-container between">
				<h3>{props.company}</h3>
				<h3>{props.years}</h3>
			</div>
			<div className="my-container between">
				<h5>{props.position}</h5>
			</div>
		</div>
	);
};

const styles = {};

export default Job;
